// Kotlin JVM 지원 추가 .kt (Kotlin 파일) 사용
kotlin("jvm") version "1.9.10"
}

dependencies {
// flexmark Markdown parser (.md파일을 컨트롤러에서 html로 파싱)
implementation("com.vladsch.flexmark:flexmark-all:0.64.0")
}

// Kotlin 컴파일 설정 추가 (선택적이지만 권장)
tasks.withType<org.jetbrains.kotlin.gradle.tasks.KotlinCompile> {
kotlinOptions {
jvmTarget = "17" // 자바와 동일하게 설정
}
}

// 블로그 글 조회
@GetMapping(value = "/articles/{id}", produces = MediaType.APPLICATION_JSON_UTF8_VALUE)
public String getArticle(@PathVariable Long id, Model model) {
Article article = blogService.findById(id);
// Markdown → HTML 변환
String html = MarkdownUtil.toHtml(article.getContent());
model.addAttribute("article", new ArticleViewResponse(article));
model.addAttribute("contentHtml", html);
return "article";
}

package com.example.util
import com.vladsch.flexmark.ext.tables.TablesExtension
import com.vladsch.flexmark.parser.Parser
import com.vladsch.flexmark.util.data.MutableDataSet
import com.vladsch.flexmark.html.HtmlRenderer
object MarkdownUtil {
@JvmStatic
fun toHtml(markdown: String): String {
val options = MutableDataSet().apply {
set(Parser.EXTENSIONS, listOf(TablesExtension.create()))
}
val parser = Parser.builder(options).build()
val renderer = HtmlRenderer.builder(options).build()
val document = parser.parse(markdown)
return renderer.render(document)
}
}
